import json
from base64 import b64decode
from Crypto.Cipher import AES
from Crypto.Util.Padding import unpad
import binascii

# 替换为实际的AES密钥和加密数据
EXAM_AES_KEY = "nm5387945d5d4c91047b3b50234ca7ak"
encrypted_data_hex = ""
# 解析UTF-8格式的AES密钥
aes_key = EXAM_AES_KEY.encode('utf-8')
# 将加密的数据从16进制格式解析为字节
encrypted_bytes = binascii.unhexlify(encrypted_data_hex)
# 创建一个AES密码对象，使用ECB模式和PKCS7填充
cipher = AES.new(aes_key, AES.MODE_ECB)
# 解密数据
decrypted_bytes = cipher.decrypt(encrypted_bytes)
# 去掉PKCS7填充的内容
decrypted_data = unpad(decrypted_bytes, AES.block_size)
# 将解密后的数据转换为UTF-8字符串
decrypted_string = decrypted_data.decode('utf-8')
data = json.loads(decrypted_string)
print(data)
